import React from 'react';
import ReactDOM from 'react-dom';
import './card.css';
import 'bootstrap/dist/css/bootstrap.min.css'

const card=({ robots })=>{
    return(
        <div className="row">
            <div className="col">
                <div className="pics">
                    <img src={`https://robohash.org/${ robots.username }?200*200`} alt="pro" />
                    <div>
                        <h1>
                            { robots.name }
                        </h1>
                        <h1>
                            { robots.email }
                        </h1>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default card;
